(28818, 86424, 0, 1, '黑桃七樂團SpadeSieben-太遠deno', '', '2010-11-01 00:00:00', 0000, 0, 2, 4, '太遠\r\n作詞：陳詩婕(史旺)  作曲：陳詩婕(史旺) 編曲：黑桃七樂團\r\n\r\n什麼時候開始陪伴我的是手上的菸\r\n原本應該在我身旁的你  怎麼消失不見\r\n一直以為我要離開這裡的前一天\r\n你抱著我哭著問我  能不能不要說再見\r\n後面是海邊  你一直想去的地點\r\n而我的面前是你淚流滿面的臉\r\n離我太遠  你給的愛我看不見\r\n眼淚流的再多  也無法再見妳一面\r\n離你太遠  我的思念你看不見\r\n而你不在身邊  只怕愛會慢慢慢慢變遷\r\n一直以為這次真的可以就走到永遠\r\n給你的歌才寫到一半  劇情就突然改變\r\n分手那天這邊下著大雨模糊我視線\r\n我有多愛你  為什麼竟然到最後才發現\r\n望著地平線  腦中倒轉甜蜜畫面\r\n停格的瞬間  才驚覺已經是從前\r\n離我太遠  你給的愛我看不見\r\n眼淚流的再多  也無法再見妳一面\r\n離你太遠  我的思念你看不見\r\n而你不在身邊  只怕愛會慢慢慢慢變遷\r\n', '', 328, '', '史旺', '史旺', '黑桃七樂團', '', '', 0, 0, 1, '2010-11-01 18:41:16', '2013-10-07 17:17:14', '0000-00-00 00:00:00'),
(28819, 86424, 0, 1, '黑桃七樂團SpadeSieben-陪伴demo', '', '2010-11-01 00:00:00', 0000, 0, 2, 4, '陪伴\r\n詞：王英傑(蹦蹦)\r\n曲：賴廷維(賴賴)\r\n\r\n這條路感謝有你伴阮鬥陣行\r\n不管路途多酸甜苦澀\r\n都是有你陪伴阮  來行\r\n\r\n你是我靈魂的一半\r\n有你有我互相來牽成\r\n日日夜夜夢你來  陪伴阿\r\n心情壞  是你惦在阮欸身邊唱歌\r\n\r\n用你的青春一路陪伴\r\n用你的雙手牽阮來行\r\n你付出一生不管犧牲溫暖阮心肝\r\n\r\n用你的青春一路陪伴\r\n用你的笑容乎阮作伴\r\n你是我一生   一生唯一的陪伴', '', 279, '', '賴賴', '蹦蹦', '黑桃七樂團', '', '', 0, 0, 1, '2010-11-01 18:50:42', '2013-10-07 17:17:14', '0000-00-00 00:00:00'),
(28820, 86424, 0, 1, '黑桃七樂團SpadeSieben-愛我很久demo', '', '2010-11-01 00:00:00', 0000, 0, 2, 4, '愛我很久 \r\n詞：史旺\r\n曲：史旺\r\n\r\n日復一日同樣的生活\r\n我好想試圖逃離這生活\r\n有太多事情包圍著我\r\n可是卻找不到一個人愛我\r\n\r\n黎明之前  天黑以後\r\n一個人總是特別孤單寂寞\r\n一直有句話不敢說出口\r\n其實我早就喜歡你很久 很久 很久\r\n\r\n多希望你能看穿我的心底\r\n其實很喜歡你\r\n每一分每一秒鐘我的眼睛\r\n都只看的見你               \r\n\r\n', '', 221, '', '史旺', '史旺', '黑桃七樂團', '', '', 0, 0, 1, '2010-11-01 18:57:06', '2013-10-07 17:17:14', '0000-00-00 00:00:00'),
