(28824, 79791, 0, 1, '生活', '我想傳達的是一種安靜的力量。\r\n如果你們聽了也因此而感受到了什麼。\r\n那對我來說就是最棒的回饋。\r\n\r\n', '2010-11-07 00:00:00', 2000, 0, 1, 5, '大力擁抱後的自我 不去多想的只是感受\r\n慢慢地走從容不迫 沒有理由的只是接受\r\n這就是生活 這就是生活 (這都是生活/這都只是生活)\r\n學著去疑惑試圖找到真我 或許只是在那簡單背後\r\n你講的輕鬆我也認真點頭 愛護不要只是隨便說說\r\n這也是生活 這也只是生活\r\n放開手中緊握的安逸 讓有時殘暴的空氣學著安靜\r\n再讓自己埋進真實的世界裡\r\n偶爾享受迷路的樂趣 只是沿途風景有時讓人太著迷\r\n不要忘了 要記得回來繼續\r\n', '', 378, '', '葉子', '葉子', '', '耳語音樂', '', 0, 1, 0, '2010-11-02 11:49:18', '2015-03-12 13:44:10', '0000-00-00 00:00:00'),
(28825, 79791, 0, 1, '一個人去旅行', '移動的時候 我總是想著那些曾經穿越過的畫面。\r\n而獨自的時候 我也只是繼續回憶那些早就被安置置放的所有。\r\n\r\n對我來說。 也就只是這樣的過程。', '2010-11-07 00:00:00', 2000, 0, 1, 5, '天很藍 雲很白 今天應該適合去旅行\r\n翻開昨天的日記 我檢查受傷的痕跡\r\n一個人的旅行或許可以重新找到自己\r\n習慣了安靜 不需要熟悉的言語\r\n我們都可以 自由勇敢的去追尋 暫時忘記都市的安逸 走入森林的小徑\r\n綠草如茵 呼吸新鮮的空氣 搭拉搭拉\r\n一個人的旅行 重新整理過往褪色曾經\r\n看看身邊的風景 回想昨日的失去\r\n一個人的旅行 再次看到遼闊的自己\r\n看看身邊的風景 擁抱自然的美麗\r\n今天來的時候 是否還有 是否還有意義\r\n明天來的時候 是否我就 我就不再哭泣\r\n', '', 307, '', '葉子', '葉子', '', '耳語音樂', '', 0, 0, 0, '2010-11-02 11:57:41', '2015-03-12 13:44:10', '0000-00-00 00:00:00'),
(28826, 79791, 0, 1, '再給我多一天', '如果可以。\r\n"繼續"  這是一種多麼堅定的力量?\r\n\r\n所以沒有放棄，只有繼續。\r\n\r\n再給我多一天。', '2010-11-07 00:00:00', 2000, 0, 1, 5, '說好了練習的時候在今天 拉住偷懶的心願開始實現\r\n跟著畫面開始擺脫從前 然後讓自己慢慢沉澱\r\n動起來讓陽光曬在我的裡面 動起來讓時間開始跑在我的前面\r\n放開懷所有陰霾咻地不見 靠過來我門一起大聲的說 喔喔\r\n再給我多一天 我就會告別疑惑的腐朽\r\n再給我多一天 新的劇情就會上演\r\n真的再給我多一天 我真的就能睜開雙眼擁抱明天\r\n再給我多一天 喔\r\n', '', 224, '', '葉子', '葉子', '', '耳語音樂', '', 0, 0, 0, '2010-11-02 12:02:58', '2015-03-12 13:44:10', '0000-00-00 00:00:00'),
