(28916, 86446, 0, 1, '跑徑', '作詞者是團裡的女主唱\r\n她是學校田徑校隊的一員\r\n在一起練習和跑步的過程中\r\n因為有著大家的陪伴 同儕們的鼓勵和加油\r\n所以身體上的痛苦 還有心理上的競賽壓力 都不算什麼: )\r\n\r\n這首歌記下 在一起練習跑河堤五公里的訓練中\r\n微風 陽光和奔跑的快樂 與輕盈\r\n\r\n', '2010-11-02 00:00:00', 2000, 10, 0, 4, '天 在飛翔 過路的風 也在追\r\n想 的意念 有穿透力的 向前\r\n呼 吸 揮灑 情緒\r\n腳 步 自由 踩踏\r\n\r\n跑 過 是 滿足\r\n一起 過 是 友情\r\n\r\n也許有的時候 我會懷疑自己真的不行\r\n但是 我有你 但是我有妳\r\n怯弱時候想想你們 心情自然就會變好\r\n感謝我有你 感謝我有你\r\n別懷疑\r\n\r\n雨 滴落下 伸出手掌 握住它\r\n放在胸口 然後輕輕地滑下\r\n雨水 不會阻擋\r\n而我 會更堅強\r\n\r\n雨過 是天青\r\n一起過 是有情', '', 215, '', 'kjohn', '阿璞', '大寶', '', '', 0, 1, 0, '2010-11-02 21:38:42', '2015-03-12 13:44:13', '0000-00-00 00:00:00'),
(28917, 86446, 0, 1, '有夢的樣子', '未來的幸福家庭生活\r\n是作曲作詞者的嚮往\r\n她也知道她自己有著自己的步調\r\n所以 我們有我們的世界 我們也有我們的幸福\r\n', '2010-11-02 00:00:00', 2000, 10, 0, 7, '有夢的樣子\r\n像天邊掛著星子\r\n投影你我的影子\r\n在呼喊誰的名字\r\n\r\n在我們住的房子\r\n有歡笑中的孩子\r\n一起坐一張椅子\r\n拿著喝奶的瓶子\r\n\r\n我們學不會的\r\n就慢慢地走\r\n喔慢慢地學會了\r\n\r\n我們不想懂得\r\n就不要記得\r\n喔一步一步走\r\n\r\n我們有\r\n我們的世界\r\n我們有\r\n我們的幸福\r\n我們有\r\n我們的時間\r\n我們有\r\n我們的幸福\r\n\r\n步步向前走\r\n步步向前走\r\n步步向前、向前走\r\n', '', 163, '', '阿璞', '阿璞', '大寶', '', '', 0, 1, 0, '2010-11-02 21:40:45', '2015-03-12 13:44:13', '0000-00-00 00:00:00'),
(28918, 15466, 0, 1, '春風吹', '新歌「春風吹」上架！\r\n安妮朵拉「朵簡單、朵瘋狂」活動熱烈進行中\r\n請前往安妮朵拉官網參加活動！\r\nhttp://tw.beta.streetvoice.com/writing/annechang1204/\r\n朵拉迷有機會得到獨立設計品牌ALLENBLUE的包包兩款！\r\n  \r\n//------------------------------------------------------------------------------//\r\n\r\n春風吹是安妮朵拉繼阿嬤的白頭鬃之後的第二首台語創作 \r\n不同於阿嬤白頭鬃的情感牽絆 \r\n輕鬆舒爽的春風吹傳達的是安妮的愛情觀 \r\n遇到對的人就遇到 \r\n遇到不對的人 一個人過也很好 \r\n\r\n一個人一輩子一定要談很多戀愛才夠本嗎? \r\n不能跟初戀的對象相守一輩子就很遺憾嗎? \r\n\r\n你說呢? \r\n', '2010-11-02 00:00:00', 2000, 0, 2, 5, '春風吹\r\n\r\n是安怎 志明甲春嬌恁兩個\r\n沒法度來作伙\r\n甘講是天公伯仔故意來戲弄\r\n才會來拆散恁兩個\r\n\r\n要安怎 這段感情抹來放風吹\r\n多久才倘雙對雙飛\r\n緣分哪夠就一世人\r\n哪不夠攏是朋友來交陪\r\n\r\n人說作伙是相欠債 抹凍鬥陣就自由飛\r\n人生短短 何必單戀一枝花\r\n一個人輕輕鬆鬆嘛真好過\r\n\r\n人海茫茫真心難找 山盟海誓是一句話\r\n春風一直吹 緣分無底買\r\n真心來等待 有緣人來作伙\r\n', '', 249, '', '安妮', '安妮', '阿樊', '', '', 1, 0, 1, '2010-11-02 21:54:36', '2013-10-07 17:17:15', '0000-00-00 00:00:00'),
