(28933, 8431, 2870, 9, 'On How To Be Lonely', '', '2010-11-03 00:00:00', 2000, 20, 0, 16, '', 'On how to be lovely\n(On how to be lovely) \nYou got to be happy \n(You got to be happy) \nWhen you can feel \nlight and gay \nThen you''ll be lovely \nas a holiday.\n\nOn how to be charming \n(On how to be charming) \nYou got to be merry \n(You got to be merry) \nIf only to weave a spell \nAnd you''ll be lovely \nAs a carousel too.\n\nI (I know you can) show how. \nIt''s (it''s all in the) know-how. \nAnd (and once you know) oh how \nThe world looks good to you \nAs it should to you.\n\nOn how to be lovely \n(On how to be lovely) \nYou got to be jolly \n(You got to be jolly) \nWhen you can be fancy-free\nAnd flash a smile that \nFolks come flocking to see.\n\nYou''ll be as lovely \nAs can be.\n\nDo-wee-oo \nDo-wee-oo-ee \nDo-wee-oo \nDo-wee-oo-ee \nDo-wee-oo \nDo-wee-oo \nBoo-diddly-ba-bau! Ee-\n\nDo-wee-oo \nDo-wee-oo-ee \nDo-wee-oo \nDo-wee-oo-ee \nDo-wee-oo \nDo-wee-oo \nBoo-diddly-ba-bau!\n(Boo-diddly-ba-bau!)\nBoo-diddly-ba-baa-pa-daa!\n\nCan''t (can''t do it with) make-up \nYou (you''ve just got to) wake up \nAnd (and startin'' to) take up \nA life delirious \nNothing serious.\n\nOn how to be lovely \n(On how to be lovely) \nYou got to be cheery \n(You got to be cheery) \nI''ll give you a guarantee \nYou don''t need dough \nYou don''t need a college degree.\n\nMake sorrow incidental \n(Let joy be monumental) \nAnd you''ll be lovely \nDo-wee-oo \nDo-wee-oo(-ee)\nDo-wee-oo \nDo-wee-oo(-ee)\nYou''ll be as lovely \nAs can be\nA-do-ee-oo-ee-oo-ee-oo!', 162, '', '', '', '', '', '', 0, 1, 0, '2010-11-03 16:04:32', '2015-03-12 13:44:13', '0000-00-00 00:00:00'),
